import React from 'react'
import dataSlidebar from './dataSlidebar.json'


export default function Func(props) {

    
    console.log(dataSlidebar)


    if (props.pth=="/"){
        return (
            <div>
              <div>
                
                <div class="list-type5 mt-5">
                  <ol>
                                {dataSlidebar.map((it) => 
                                <li>{it.Ac.CoursN1.filename}</li>
                                )}
                  </ol>
                </div>
              </div>
            </div>
          )
        }

    if (props.pth=="/PremierAcCours"){
        return (
            <div>
              <div>
                
                <div class="list-type5 mt-5">
                  <ol>
                                {dataSlidebar.map((it) => 
                                <li>{it.Ac.CoursN1.filename}</li>
                                )}
                  </ol>
                </div>
              </div>
            </div>
        )
        }



 
}
